import React from 'react';
import ReactDOM from 'react-dom/client';
import './design.css';
const title="call family";
const root=ReactDOM.createRoot(document.getElementById('root'));
root.render(
 <div>
    <h1 className="mystyle">{title}</h1>
    <b className='content'></b>
 </div>
);
